import React from 'react';

const Pagination = ({
  pageIndex,
  pageOptions,
  canPreviousPage,
  previousPage,
  canNextPage,
  nextPage
}) => {
  return (
    <div>
      <span>
        Page{' '}
        <strong>
          {pageIndex + 1} of {pageOptions.length}
        </strong>{' '}
      </span>
      <button onClick={previousPage} disabled={!canPreviousPage}>
        Previous
      </button>
      <button onClick={nextPage} disabled={!canNextPage}>
        Next
      </button>
    </div>
  );
};

export default Pagination;
